.player-header,
.player-track {
    border: 1px solid #000!important;
    background-color: #202222!important;
    padding: 0 4px 0 4px;
}
.maximized-player {
    background: linear-gradient(-60deg, #131d2f, #262525, #13556a, #131d2f, #332e2e, #13556a);
    background-size: 250% 110%;
    animation: GradientPlayer 30s ease infinite;
}
@keyframes GradientPlayer {
    0% {
        background-position: 100%;
    }
    25% {
        background-position: 50%;
    }
    50% {
        background-position: 0%;
    }
    75% {
        background-position: 50%;
    }
    100% {
        background-position: 100%;
    }
}

#maximized-player > div.player-tracks-empty-hint > div:nth-child(2) {width:240px; height:340px;
    background: url('data:image/gif;base64,')!important;
}
